        private List<Messurment> MessurmentData { get; set; } = new List<Messurment>();
        private Dictionary<string, List<int>> UsedSqInch { get; set; } = new Dictionary<string, List<int>>();


        public int Star1()
        {
            BuildMessurmentList();
            Run();
            return UsedSqInch.Where(x => x.Value.Count > 1).Count();
        }

        public int Star2()
        {
            BuildMessurmentList();
            Run();
            return FindUnused();
        }

        private void Run()
        {
            foreach (var messurment in MessurmentData)
            {
                var xLoc = messurment.FromLeft;
                var yLoc = messurment.FromTop;

                for (var x = 0; x < messurment.Wide; x++)
                {
                    for (var y = 0; y < messurment.Tall; y++)
                    {
                        var curXLoc = (xLoc + x);
                        var curYLoc = (yLoc + y);
                        var key = $"{curXLoc},{curYLoc}";
                        if (UsedSqInch.ContainsKey(key))
                        {
                            UsedSqInch[key].Add(messurment.Id);
                        }
                        else
                        {
                            UsedSqInch[key] = new List<int> { messurment.Id };
                        }

                    }
                }
            }
        }

        private int FindUnused()
        {
            foreach (var messurment in MessurmentData)
            {
                var xLoc = messurment.FromLeft;
                var yLoc = messurment.FromTop;
                bool overlapFound = false;
                for (var x = 0; x < messurment.Wide; x++)
                {
                    for (var y = 0; y < messurment.Tall; y++)
                    {
                        var curXLoc = (xLoc + x);
                        var curYLoc = (yLoc + y);
                        var key = $"{curXLoc},{curYLoc}";

                        if (UsedSqInch[key].Count() > 1)
                        {
                            overlapFound = true;
                        }

                    }
                }
                if (overlapFound)
                {
                    continue;
                }
                return messurment.Id;
            }
            throw new Exception("did not find it");
        }




        private void BuildMessurmentList()
        {
            foreach (var item in this.data)
